// Import the React library (a special tool for making websites) 
import React from 'react';

// Define a component called basicInfo. This component shows information about a person.
// It receives a 'person' as a special thing called 'props', which has details like 'name', 'title', and 'phoneNumber'.
const BasicInfo = ({ person }) => (
  // Inside this component, there is a 'div' (a container) with a special style named 'App'.
  <div className="App">
    {/* Inside the container, there is a big title (h1) that shows the person's name */}
    <h1>{person.name}</h1>
    {/* Below the big title, there is a smaller title (h2) that shows the person's job title */}
    <h2>{person.title}</h2>
    {/* Right under the job title, there is a paragraph (p) that shows the person's phone number */}
    <p>{person.phoneNumber}</p>
    {/* You can add more things here to show additional details about the person */}
  </div>
);

// Make this BasicInfo component available for others to use
export default BasicInfo;
